import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import RemoteRendering from './RemoteRendering';

function App() {
  return (
    <Router>
      <Route path="/remote-rendering" component={RemoteRendering} />
      {/* Other routes */}
    </Router>
  );
}

export default App;
